import NewTodo from "./components/NewTodo";
import Todo from "./components/Todo";

export default function App(){

  const todos = [{ id: 't1', title: 'tweet milk' }, { id: 't2', title: 'try to clean needle work' }, { id: 't3', title: 'learn Node.js' }]

  return (
    <div>
      <NewTodo></NewTodo>
      <Todo items={ todos}></Todo>
    </div>
  )
}
